options.systemMessage:
=** Prompt Objective **
Combine the visual style and character details into three cinematic image prompts. Each prompt should feature one character and apply the same visual style. Use their clothing and color scheme to create highly detailed, emotionally rich scenes.

At the end of each prompt, include a specs block defining resolution, aspect ratio, and rendering quality.

** STYLE INPUT **

Style Description:
{{ $('Create Style').item.json.output.style }}
Character Placement:
{{ $('Create Style').item.json.output.character_placement }}
Character Size:
{{ $('Create Style').item.json.output.character_size }}
Character Facing:
{{ $('Create Style').item.json.output.character_facing }}
Dimensionality:
{{ $('Create Style').item.json.output.dimensionality }}
Art Profile:
{{ $('Create Style').item.json.output.art_profile }}

** CHARACTERS INPUT **

---- Character 1

Name: {{ $('Generate 3 Characters').item.json.output[0].name }}
Origin: {{ $('Generate 3 Characters').item.json.output[0].origin }}
Clothing: {{ $('Generate 3 Characters').item.json.output[0].clothing }}
Color Scheme: {{ $('Generate 3 Characters').item.json.output[0].color_scheme }}

---- Character 2

Name: {{ $('Generate 3 Characters').item.json.output[1].name }}
Origin: {{ $('Generate 3 Characters').item.json.output[1].origin }}
Clothing: {{ $('Generate 3 Characters').item.json.output[1].clothing }}
Color Scheme: {{ $('Generate 3 Characters').item.json.output[1].color_scheme }}

---- Character 3

Name: {{ $('Generate 3 Characters').item.json.output[2].name }}
Origin: {{ $('Generate 3 Characters').item.json.output[2].origin }}
Clothing: {{ $('Generate 3 Characters').item.json.output[2].clothing }}
Color Scheme: {{ $('Generate 3 Characters').item.json.output[2].color_scheme }}

** PROMPT REQUIREMENTS **

For each prompt:

- Begin with the phrase: [Character Name] from [Origin]
- Integrate their clothing and color scheme
- Apply all provided style inputs
- Describe the scene vividly to match the cinematic tone and setting
- Include only one character per prompt

parameters.jsCode:
const prompts = $input.first().json.output;

return prompts.map(p => ({
  json: {
    textToImagePrompt: p.textToImagePrompt.replace(/\n/g, ' ')
  }
}));

const items = $input.all();

// Get all `url` values from the input items
const mediaURLs = items.map(i => i.json.url);

// Return a single object containing the array of URLs
return [
  {
    json: {
      mediaURLs
    }
  }
];

